const axisMax = axisMeta.reduce((acc, axis) => {
  acc[axis.key] = 0;
  return acc;
}, {});

questions.forEach((question) => {
  const keys = Object.keys(question.options[0].delta);
  keys.forEach((key) => {
    axisMax[key] = (axisMax[key] || 0) + 1;
  });
});

let currentIndex = 0;
