let lastResultData = null;

function createEmptyScores() {
  return axisMeta.reduce((acc, axis) => {
    acc[axis.key] = 0;
    return acc;
  }, {});
}

function applyDelta(delta, factor) {
  const multiplier = factor ?? 1;
  Object.entries(delta).forEach(([key, value]) => {
    scores[key] += value * multiplier;
  });
}

function setView(view) {
  hero.classList.toggle("hidden", view !== "hero");
  quiz.classList.toggle("hidden", view !== "quiz");
  result.classList.toggle("hidden", view !== "result");
  document.body.classList.toggle("hero-view", view === "hero");
  closeShareOverlay();
  window.scrollTo({ top: 0, behavior: "smooth" });
}

function renderQuestion() {
  const total = questions.length;
  const question = questions[currentIndex];
  questionIndex.textContent = `${currentIndex + 1}/${total}`;
  questionText.textContent = formatQuestionText(question.text);
  progressBar.style.width = `${Math.round(((currentIndex + 1) / total) * 100)}%`;

  optionsWrap.innerHTML = "";
  question.options.forEach((option, index) => {
    const button = document.createElement("button");
    button.type = "button";
    button.className = "option";
    button.textContent = option.desc;
    button.addEventListener("click", () => handleAnswer(index, button));
    optionsWrap.appendChild(button);
  });
}

function formatQuestionText(text) {
  const value = String(text || "").trim();
  if (value.includes("") && value.includes("")) {
    return value
      .replace(/^[]?/, "")
      .replace(/[]??$/, "");
  }
  return value;
}

function handleAnswer(optionIndex, selectedButton) {
  if (selectedButton) {
    const optionButtons = optionsWrap.querySelectorAll(".option");
    optionButtons.forEach((button) => {
      button.disabled = true;
    });
    selectedButton.classList.add("is-selected");
    setTimeout(() => {
      handleAnswer(optionIndex);
    }, 120);
    return;
  }

  const question = questions[currentIndex];
  const selected = question.options[optionIndex];
  applyDelta(selected.delta, 1);
  answers.push(selected.delta);
  currentIndex += 1;

  if (currentIndex >= questions.length) {
    showResult();
    return;
  }

  renderQuestion();
}

function showResult() {
  const axisResults = axisMeta.map((axis) => {
    const score = scores[axis.key];
    const max = axisMax[axis.key] || 2;
    const isPos = score >= 0;
    const label = isPos ? axis.pos.name : axis.neg.name;
    const letter = isPos ? axis.pos.letter : axis.neg.letter;
    const percent = Math.round(((score + max) / (2 * max)) * 100);
    return {
      key: axis.key,
      score,
      max,
      label,
      letter,
      isPos,
      pos: axis.pos,
      neg: axis.neg,
      percent
    };
  });

  const letters = axisResults.map((axis) => axis.letter);
  const code = letters.join("");
  const profile = baseProfiles[code] || baseProfiles["RAGU"];
  const directSentence = axisResults[0].isPos
    ? ""
    : "";
  const initiativeSentence = axisResults[1].isPos
    ? ""
    : "";
  const empathySentence = axisResults[2].isPos
    ? ""
    : "";
  const tempoSentence = axisResults[3].isPos
    ? ""
    : "";
  const posterDirectSentence = axisResults[0].isPos
    ? ""
    : "";
  const posterInitiativeSentence = axisResults[1].isPos
    ? ""
    : "";
  const posterEmpathySentence = axisResults[2].isPos
    ? ""
    : "";
  const posterTempoSentence = axisResults[3].isPos
    ? ""
    : "";
  const posterLines = [
    posterDirectSentence,
    posterInitiativeSentence,
    posterEmpathySentence,
    posterTempoSentence
  ];
  const posterDesc = posterLines.join(" ");
  const resultName = `${code} ${profile.title}`;
  const extras = getResultExtras(code);

  if (resultCode) {
    resultCode.textContent = code;
  }

  axisList.innerHTML = axisResults
    .map((axis) => {
      const leftPercent = axis.percent;
      const rightPercent = 100 - leftPercent;
      return `
      <div class="axis-row">
        <div class="axis-head">
          <span class="axis-label">${axis.pos.short}</span>
          <span class="axis-percent">${leftPercent}%  /  ${rightPercent}%</span>
          <span class="axis-label axis-label-right">${axis.neg.short}</span>
        </div>
        <div class="axis-sub">
          <span class="axis-sub-label">${axis.pos.en || ""}</span>
          <span class="axis-sub-label axis-sub-right">${axis.neg.en || ""}</span>
        </div>
        <div class="axis-bar">
          <div class="axis-fill" style="width: ${leftPercent}%;"></div>
        </div>
      </div>
    `;
    })
    .join("");

  const tips = buildSocialTips(axisResults);
  if (resultDesc) {
    resultDesc.textContent = posterDesc;
  }
  if (resultBuddy) {
    const buddySlot = extras.buddySlot || "";
    resultBuddy.textContent = `AI${buddySlot}`;
  }
  if (matchName) {
    matchName.textContent = extras.matchName || "xxxx";
  }
  if (matchDesc) {
    matchDesc.textContent = extras.matchDesc || "";
  }

  lastResultData = {
    resultName,
    code,
    profileTitle: profile.title,
    desc: `${profile.title}${profile.desc} ${directSentence} ${initiativeSentence} ${empathySentence} ${tempoSentence}`,
    posterDesc,
    posterLines,
    axes: axisResults,
    axisLabels: axisResults.map((axis) => axis.label),
    extras,
    tips
  };

  lastShareText = buildShareText(code, profile.title, tips);

  setView("result");
}

function buildSocialTips(axisResults) {
  const tips = [];
  const axisMap = Object.fromEntries(axisResults.map((axis) => [axis.key, axis]));

  tips.push(
    axisMap.direct.isPos
      ? {
          title: "",
          desc: ""
        }
      : {
          title: "",
          desc: ""
        }
  );

  tips.push(
    axisMap.initiative.isPos
      ? {
          title: "",
          desc: ""
        }
      : {
          title: "",
          desc: ""
        }
  );

  tips.push(
    axisMap.empathy.isPos
      ? {
          title: "",
          desc: ""
        }
      : {
          title: "",
          desc: ""
        }
  );

  tips.push(
    axisMap.tempo.isPos
      ? {
          title: "",
          desc: ""
        }
      : {
          title: "",
          desc: ""
        }
  );

  return tips;
}

function buildShareText(code, profileTitle, tips) {
  const tipTitles = tips.map((tip) => tip.title).join(" / ");
  return `${code}${profileTitle}${tipTitles}AI`;
}

function getResultExtras(code) {
  return resultExtrasByCode[code] || resultExtrasByCode.default;
}

async function createPosterImage() {
  if (!lastResultData) {
    return null;
  }
  if (document.fonts && document.fonts.ready) {
    try {
      await document.fonts.ready;
    } catch (error) {
      // Font loading is best-effort for the poster.
    }
  }
  const logo = await loadPosterLogo();
  return drawPoster(lastResultData, { logo });
}

function loadPosterLogo() {
  if (posterLogoImage) {
    return Promise.resolve(posterLogoImage);
  }
  if (posterLogoPromise) {
    return posterLogoPromise;
  }
  posterLogoPromise = new Promise((resolve) => {
    const img = new Image();
    img.onload = () => {
      posterLogoImage = img;
      resolve(img);
    };
    img.onerror = () => resolve(null);
    img.src = POSTER_LOGO_SRC;
  });
  return posterLogoPromise;
}

function drawPoster(data, assets = {}) {
  const width = 340;
  const height = 548;
  const ratio = Math.min(window.devicePixelRatio || 1, 2);
  const canvas = document.createElement("canvas");
  canvas.width = width * ratio;
  canvas.height = height * ratio;
  const ctx = canvas.getContext("2d");
  ctx.scale(ratio, ratio);
  ctx.textBaseline = "top";
  ctx.textAlign = "left";

  ctx.fillStyle = "#ffeb88";
  ctx.fillRect(0, 0, width, height);

  ctx.fillStyle = "#ffffff";
  drawRoundedRect(ctx, 28, 38, 164, 219, 12);
  ctx.fill();

  ctx.fillStyle = "#000";
  ctx.font = "16px \"DouyinSans\", \"PingFang SC\", system-ui, sans-serif";
  ctx.fillText("", 199, 38);

  ctx.font = "40px \"DouyinSans\", \"PingFang SC\", system-ui, sans-serif";
  ctx.fillText(data.code, 199, 54);

  const posterLines = data.posterLines?.length
    ? data.posterLines
    : [data.posterDesc || data.desc];
  ctx.font = "10px \"PingFang SC\", system-ui, sans-serif";
  drawParagraph(ctx, posterLines.join("\n"), 202, 98, 105, 14);

  const axisMap = Object.fromEntries((data.axes || []).map((axis) => [axis.key, axis]));
  const barWidth = 282;
  const barHeight = 6;
  const barLeft = 28;
  const barRows = [
    { key: "direct", y: 312 },
    { key: "initiative", y: 358 },
    { key: "empathy", y: 404 },
    { key: "tempo", y: 450 }
  ];

  ctx.fillStyle = "#ffffff";
  barRows.forEach((row) => {
    drawRoundedRect(ctx, barLeft, row.y, barWidth, barHeight, 8);
    ctx.fill();
  });

  barRows.forEach((row) => {
    const axis = axisMap[row.key];
    const leftPercent = axis ? axis.percent : 50;
    const fillWidth = Math.max(0, Math.round((leftPercent / 100) * barWidth));
    if (fillWidth > 0) {
      ctx.fillStyle = "#ffbcbc";
      drawRoundedRect(ctx, barLeft, row.y, fillWidth, barHeight, 8);
      ctx.fill();
    }
  });

  ctx.fillStyle = "#7d7d7d";
  ctx.font = "10px \"PingFang SC\", system-ui, sans-serif";
  ctx.textAlign = "left";
  ctx.fillText("Raw", 28, 298);
  ctx.fillText("Wrapped", 267, 298);
  ctx.fillText("Active", 28, 344);
  ctx.fillText("Backseat", 267, 344);
  ctx.fillText("Gentle", 29, 390);
  ctx.fillText("Unscripted", 29, 436);
  ctx.textAlign = "right";
  ctx.fillText("Logical", 310, 390);
  ctx.fillText("Verified", 310, 436);

  ctx.fillStyle = "#000";
  ctx.font = "16px \"DouyinSans\", \"PingFang SC\", system-ui, sans-serif";
  ctx.textAlign = "right";
  ctx.fillText("", 60, 281);
  ctx.fillText("", 60, 327);
  ctx.fillText("", 60, 374);
  ctx.fillText("", 60, 420);
  ctx.fillText("", 311, 282);
  ctx.fillText("", 310, 326);
  ctx.fillText("", 310, 374);
  ctx.fillText("", 311, 420);

  ctx.fillStyle = "#000";
  ctx.font = "16px \"PingFang SC\", system-ui, sans-serif";
  const directPercent = axisMap.direct ? axisMap.direct.percent : 50;
  const initiativePercent = axisMap.initiative ? axisMap.initiative.percent : 50;
  const empathyPercent = axisMap.empathy ? axisMap.empathy.percent : 50;
  const tempoPercent = axisMap.tempo ? axisMap.tempo.percent : 50;
  ctx.textAlign = "right";
  ctx.fillText(`${directPercent}%  /  ${100 - directPercent}%`, 220, 290);
  ctx.fillText(`${initiativePercent}%  /  ${100 - initiativePercent}%`, 220, 336);
  ctx.fillText(`${empathyPercent}%  /  ${100 - empathyPercent}%`, 220, 382);
  ctx.fillText(`${tempoPercent}%  /  ${100 - tempoPercent}%`, 220, 428);

  ctx.fillStyle = "#d9d9d9";
  ctx.fillRect(277, 498, 33, 33);

  ctx.fillStyle = "#717171";
  ctx.font = "8px \"PingFang SC\", system-ui, sans-serif";
  ctx.textAlign = "left";
  drawParagraph(ctx, "AI\nta", 96, 510, 120, 10);
  ctx.textAlign = "right";
  ctx.fillText("", 273, 521);

  if (assets.logo) {
    ctx.imageSmoothingEnabled = true;
    ctx.imageSmoothingQuality = "high";
    ctx.drawImage(assets.logo, 26, 501, 70, 33);
  }

  return canvas.toDataURL("image/png");
}

function drawRoundedRect(ctx, x, y, w, h, r) {
  const radius = Math.min(r, w / 2, h / 2);
  ctx.beginPath();
  ctx.moveTo(x + radius, y);
  ctx.arcTo(x + w, y, x + w, y + h, radius);
  ctx.arcTo(x + w, y + h, x, y + h, radius);
  ctx.arcTo(x, y + h, x, y, radius);
  ctx.arcTo(x, y, x + w, y, radius);
  ctx.closePath();
}

function wrapText(ctx, text, maxWidth) {
  const lines = [];
  let line = "";
  const punctuation = ",.!?;:)]}%";
  for (const char of text) {
    const testLine = line + char;
    if (ctx.measureText(testLine).width > maxWidth && line) {
      if (punctuation.includes(char)) {
        line += char;
        lines.push(line);
        line = "";
      } else {
        lines.push(line);
        line = char;
      }
    } else {
      line = testLine;
    }
  }
  if (line) {
    lines.push(line);
  }
  for (let i = 1; i < lines.length; i += 1) {
    while (lines[i] && punctuation.includes(lines[i][0])) {
      lines[i - 1] += lines[i][0];
      lines[i] = lines[i].slice(1);
    }
  }
  return lines.filter((value) => value);
}

function drawParagraph(ctx, text, x, y, maxWidth, lineHeight) {
  const paragraphs = String(text).split("\n");
  let cursorY = y;
  paragraphs.forEach((paragraph, paragraphIndex) => {
    const lines = wrapText(ctx, paragraph, maxWidth);
    lines.forEach((line, index) => {
      ctx.fillText(line, x, cursorY + index * lineHeight);
    });
    cursorY += lines.length * lineHeight;
    if (paragraphIndex < paragraphs.length - 1) {
      cursorY += lineHeight * 0.2;
    }
  });
  return cursorY;
}

function drawTags(ctx, tags, x, y, maxWidth) {
  const paddingX = 14;
  const paddingY = 8;
  const gap = 12;
  let cursorX = x;
  let cursorY = y;
  tags.forEach((tag) => {
    const textWidth = ctx.measureText(tag).width;
    const tagWidth = textWidth + paddingX * 2;
    const tagHeight = 24 + paddingY * 2;
    if (cursorX + tagWidth > x + maxWidth) {
      cursorX = x;
      cursorY += tagHeight + gap;
    }
    ctx.fillStyle = "rgba(255, 107, 74, 0.15)";
    drawRoundedRect(ctx, cursorX, cursorY, tagWidth, tagHeight, 999);
    ctx.fill();
    ctx.fillStyle = "#e04832";
    ctx.fillText(tag, cursorX + paddingX, cursorY + paddingY - 2);
    cursorX += tagWidth + gap;
  });
  return cursorY + 24 + paddingY * 2;
}

function resetQuiz() {
  currentIndex = 0;
  answers = [];
  scores = createEmptyScores();
  progressBar.style.width = "0%";
}

function showToast(message) {
  toast.textContent = message;
  toast.classList.add("show");
  setTimeout(() => toast.classList.remove("show"), 2000);
}

startBtn.addEventListener("click", () => {
  resetQuiz();
  setView("quiz");
  renderQuestion();
});

if (quickBtn) {
  quickBtn.addEventListener("click", () => {
    resetQuiz();
    questions.forEach((question) => {
      const option = question.options[Math.floor(Math.random() * question.options.length)];
      applyDelta(option.delta, 1);
    });
    showResult();
  });
}

backBtn.addEventListener("click", () => {
  if (currentIndex === 0) {
    setView("hero");
    return;
  }
  currentIndex -= 1;
  const lastDelta = answers.pop();
  if (lastDelta) {
    applyDelta(lastDelta, -1);
  }
  renderQuestion();
});

restartBtn.addEventListener("click", () => {
  setView("hero");
  closePoster();
});

shareBtn.addEventListener("click", async () => {
  if (shareOverlay) {
    shareOverlay.classList.remove("hidden");
    return;
  }
  if (navigator.share) {
    try {
      await navigator.share({
        title: "",
        text: lastShareText,
        url: window.location.href
      });
      return;
    } catch (error) {
      showToast("");
      return;
    }
  }
  showToast("");
  window.prompt("", lastShareText);
});

posterBtn.addEventListener("click", async () => {
  if (!lastResultData) {
    showToast("");
    return;
  }
  posterBtn.disabled = true;
  showToast("");
  try {
    const dataUrl = await createPosterImage();
    if (!dataUrl) {
      showToast("");
      posterBtn.disabled = false;
      return;
    }
    posterImage.src = dataUrl;
    posterOverlay.classList.remove("hidden");
  } catch (error) {
    showToast("");
  } finally {
    posterBtn.disabled = false;
  }
});

function closePoster() {
  posterOverlay.classList.add("hidden");
  posterImage.removeAttribute("src");
}

function closeShareOverlay() {
  if (!shareOverlay) {
    return;
  }
  shareOverlay.classList.add("hidden");
}

posterClose.addEventListener("click", closePoster);
posterMask.addEventListener("click", closePoster);
if (shareMask) {
  shareMask.addEventListener("click", closeShareOverlay);
}

setView("hero");
